export default function NewsList(New) {
    return (
        <div>
            <script>
                console.log("GeeksforGeeks is a portal for geeks.");
            </script>
            <img
                src={`https://ipfs.infura.io/ipfs/${New.coverImageHash}`}
                alt="image releated to new"
            />
            <div>
                <h3>{New.title}</h3>
                {(
                    <p>
                        {New.category}
                    </p>
                )}
                {(
                    <p>
                        {New.description.slice(0, 30)}...
                    </p>
                )}
            </div>
        </div>
    );
}
